def maximize_acorns(N, g_A, s_A, b_A, g_B, s_B, b_B):
    dp = [0] * (N + 1)
    AB = []
    for (a, b) in zip([g_A, s_A, b_A], [g_B, s_B, b_B]):
        if b > a:
            AB.append((a, b))
    for i in range(N + 1):
        for (a, b) in AB:
            if i - a >= 0:
                y = dp[i - a] + b - a
                if y > dp[i]:
                    dp[i] = y
    N -= dp[N]
    dp = [0] * (N + 1)
    BA = []
    for (b, a) in zip([g_B, s_B, b_B], [g_A, s_A, b_A]):
        if a > b:
            BA.append((b, a))
    for i in range(N + 1):
        for (b, a) in BA:
            if i - b >= 0:
                y = dp[i - b] + a - b
                if y > dp[i]:
                    dp[i] = y
    return N + dp[N]

